import React from 'react' 

class Form extends React.Component {

    render() {
        return(
            <form onSubmit={props.handleFormSubmit} className="new-task-form">
                <input  type="text" placeholder="New task details"/>
                <select > 
                    <option>Food</option>
                    <option>Money</option>
                    <option>Code</option>
                    <option>Misc</option>
                </select>
                <input type="submit" value="Add task"/>
            </form>
        )
    }
}

export default Form
